var eff, amp, freq, decay;
try {
    eff = effect('Elastic Controller 2');
    amp = $bm_div($bm_div(eff(1), 10), 100);
    freq = $bm_div(eff(2), 100);
    decay = $bm_div(eff(3), 100);
    function elastic(amp, freq, decay) {
        ;
        function calc(n) {
            ;
            var t = $bm_sub(time, key(n).time);
            var v = velocityAtTime($bm_sub(key(n).time, $bm_div(thisComp.frameDuration, 10)));
            return $bm_div($bm_mul($bm_mul(v, $bm_div(amp, freq)), Math.sin($bm_mul($bm_mul($bm_mul(freq, t), 2), Math.PI))), Math.exp($bm_mul($bm_mul(t, $bm_mul(decay, 2)), Math.E)));
        }
        ;
        if (numKeys == 0) {
            return 0;
        }
        ;
        var n = nearestKey(time).index;
        ;
        if (key(n).time > time)
            n--;
        return n > 1 && time <= key(n).time + 1 / decay ? calc(n) + calc(n - 1) : 0;
    }
    ;
    $bm_rt = $bm_sum(value, elastic(amp, freq, decay));
} catch (e) {
    $bm_rt = value = value;
}

